INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (0.0, "カオリ（サマー）", 24, 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 0.0, 1, "2030/12/17 14:59:59", 4, 110501, 0.0, "2019/07/31 12:00:00", 10021, 24015);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (0.0, "カオリ（サマー）", 24, 4, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 4.0, 2, "2030/12/17 14:59:59", 1, 110501, 0.0, "2019/07/31 12:00:00", 10021, 24016);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (0.0, "カオリ（サマー）", 24, 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 0.0, 3, "2030/12/17 14:59:59", 4, 110501, 0.0, "2019/07/31 12:00:00", 10021, 24017);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (0.0, "カオリ（サマー）", 24, 1, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 5.2, 4, "2030/12/17 14:59:59", 2, 110501, 0.0, "2019/07/31 12:00:00", 10021, 24018);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (0.0, "カオリ（サマー）", 24, 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 4.2, 5, "2030/12/17 14:59:59", 6, 110501, 0.0, "2019/07/31 12:00:00", 10021, 24019);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (0.0, "カオリ（サマー）", 24, 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 0.0, 6, "2030/12/17 14:59:59", 2, 110501, 0.0, "2019/07/31 12:00:00", 10021, 24020);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (0.0, "カオリ（サマー）", 24, 1, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 6.4, 7, "2030/12/17 14:59:59", 6, 110501, 0.0, "2019/07/31 12:00:00", 10021, 24021);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (0.0, "カオリ（サマー）", 24, 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 0.0, 8, "2030/12/17 14:59:59", 2, 110501, 0.0, "2019/07/31 12:00:00", 10021, 24022);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (0.0, "カオリ（サマー）", 24, 6, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 10.08, 9, "2030/12/17 14:59:59", 3, 110501, 0.0, "2019/07/31 12:00:00", 10021, 24023);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (0.0, "カオリ（サマー）", 24, 1, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 5.0, 10, "2030/12/17 14:59:59", 2, 110501, 0.0, "2019/07/31 12:00:00", 10021, 24024);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (0.0, "カオリ（サマー）", 24, 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 0.0, 11, "2030/12/17 14:59:59", 2, 110501, 0.0, "2019/07/31 12:00:00", 10021, 24025);
